import { useState, useEffect } from "react";

const ValidationSignUpCompany = () => {
  const [vaues, setValues] = useState({
    company_name: "",
    email: "",
    pass: "",
    confirm_pass: ""
  })
  const [errors, setErrors] = useState({})


  const handleChange = e => {
    const {name,value} = e.target
    setValues({
      ...values,
      [name]: value
    })
  }
  return {handleChange}
}

export default ValidationSignUpCompany;
